import React from 'react';

import './App.css';
import Board from './components/Board';
import { matrix } from './constants';

function App() {
  return (
    <div className="App">
      <h1 className="title">Maze Gandalf React</h1>
      <h3 className="sub-title">Ayuda a Gandalf a salir de Minas Morgul</h3>
      <button className="help">Pidele ayuda a la aguilas</button>
      <Board matrix={matrix} />
    </div>
  );
}

export default App;
